    false,nt"url": null,nt"notes": "Alkali bulrush (Schoenoplectus maritimus)
    is an important wetland plant species, in the Intermountain West. However, there
    is a lack of knowledge on how best to source seeds of this species for restoration
    and how environmental factors influence its productivity. We evaluated genetic diversity
    between six sites of alkali bulrush in southern Idaho and Utah: Bear Lake, Salt
    Creek, Bear River, Ogden Bay, Farmington Bay, and Fish Springs. We looked at the
    interaction of three factors important for wetland management and restoration: (1)
    hydrology; (2) plant materials used in restoration (source and diversity of seeds);
    and (3) plant success (reproduction, establishment, and productivity). This is a
    final findings report to Great Salt Lake wetland managers.",nt"owner_org":
